Relationship.create([subject_id: (Resource.find_by literal: 'T0013624').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Correspond au point de l'ordre du jour du Conseil de sécurité intitulé \"La situation concernant l'Iraq\", introduit en avril 2005. A partir de cette date, ce terme est utilisé pour toutes les sujets relatifs aux opérations militaires en Iraq et leurs conséquences. Avant cette date, seul le terme \"SITUATION IRAQ-KOWEIT\" était utilisé.", language_id: (Language.find_by name: 'fr').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0013624').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Соответствует вопросу повестки дня Совета Безопасности «Ситуация в отношении Ирака», введенному в апреле 2005 года. С этого времени используется для обозначения вопросов, относящихся к военным операциям 2003 года в Ираке и последующим событиям. Прежде используемый термин", language_id: (Language.find_by name: 'ru').id).id])
