Relationship.create([subject_id: (Resource.find_by literal: 'T0009536').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "La conviction dans la théologie chrétienne actuelle selon laquelle la pauvreté et l'oppression dans le Tiers-Monde résultent des structures politiques et économiques imposées à l'origine depuis l'extérieur par des gouvernements étrangers ou par des sociétés transnationales, et qu'il est de la responsabilité de l'Eglise d'aider à la libération de ces sociétés", language_id: (Language.find_by name: 'fr').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0009536').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Учение в современной христианской теологии, согласно которому нищета и угнетение в странах «третьем мире» вызваны наличием политических и экономических структур, в основном навязанных иностранными государствами и транснациональными корпорациями, и церковь обязана помочь населению освободиться", language_id: (Language.find_by name: 'ru').id).id])
Relationship.create([subject_id: (Resource.find_by literal: 'T0009536').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "Tendencia de la teología cristiana contemporánea, según la cual la pobreza y la opresión del Tercer Mundo se deben a las estructuras políticas y económicas impuestas principalmente desde el exterior, por los gobiernos extranjeros o las empresas transnacionales. Asimismo sostiene que la Iglesia debe asumir la responsabilidad de colaborar en la liberación de esas sociedades", language_id: (Language.find_by name: 'es').id).id])
